import React from "react";
import styled from "styled-components";

const ImageBox = styled.div`
    width: 836px;
    height: 780px;
    background-image: url('/media/sample.png');
    background-repeat: no-repeat;
    background-size: contain;
    margin-right: 20px;
`;

function LoginImage () {
    return(
        <ImageBox />
    );
}

export default LoginImage
